import React from 'react';
import './App.css';

class App extends React.Component {
  constructor() {
    this.state = {
      isLogin: true
    }
  }

  render() {
    const { isLogin } = this.state;

    return (
      isLogin ? <div>welcome</div> : <div>Flight Aware Monitoring Platform</div>
    );
  }
}

export default App;
